import { link } from 'fs';
import SignUp from './SignUp'
import LogIn from './LogIn'


export default class MainBody extends Component{
    render(){

        return(
            <div id="bgImg">
                {this.btns()}
                <Router>
                    {/* <Links /> */}
                    <Route exact path="/LogIn" component={LogIn} />
                    <Route exact path="/SignUp" component={SignUp} />
                </Router> 
            </div>
        )

    }
}
